import Card from "./components/layouts/Card";

export default (_) => (
  <div id="App">
    <First />
    <Parameter title="Title" subtitle="Subtitle" />

    <Card title="Fragment">
      <Fragment />
    </Card>

    <Card title="Random challenge">

    </Card>

    <Card />
  </div>
);
